export const Navbar = () => {
    return (
        <ul>
            <li>
                <a href="/">Home</a>
            </li>
            <li class="mr-6">
                <a href="/about">About</a>
            </li>
            <li class="mr-6">
                <a href="/blog">Blogs</a>
            </li>
        </ul>
    );
}

export default Navbar;
